import NormalComp from "./NormalComp";
import PureComp from "./PureComp";

class MainComp extends Component{
   render(){
      return(
         <div>
            <h2>Main Component</h2>
            <NormalComp/>
            <PureComp/>
            </div>
      )
   }
}
export default MainComp
